import React from 'react';
import { Link } from 'react-router-dom';

const ServiceList = () => {
    return (
        <div className="service-list-page">
            <h2>To see the list of services, please login.</h2>
            <Link to="/login">Login</Link>
            <p>If you are not registered, please <Link to="/register">register here</Link>.</p>
        </div>
    );
};

export default ServiceList;
